import { useState } from 'react'
import NFLPlayers from './components/NFLPlayers'

const App = () => {
  const [nflPlayers] = useState([
    {
      Player: "Joe Banyard",
      Team: "JAX",
      Pos: "RB",
      Att: 2
    },
    {
      "Player":"Shaun Hill",
      "Team":"MIN",
      "Pos":"QB",
      "Att":5,
    }
  ])

  return (
    <div className='container'>
      {nflPlayers.length > 0 ? (
        <NFLPlayers nflPlayers={nflPlayers} />
      ) : ( 'No NFL Players' )}
    </div>
  )
}

export default App
